import React from "react";
import { NavLink } from "react-router-dom";

const NavBar = () => {
  return (
    <div className="nav-bar">
      <NavLink to="/homeview">MemeBook</NavLink>
      <NavLink to="/feed">Feed</NavLink>
      <NavLink to="/create">Create</NavLink>
      <a href="" >Logout</a>
    </div>
  );
};

export default NavBar;
